<template>
  <div>
    <el-upload
      class="upload-demo"
      action=""
      list-type="picture-card"
      :file-list="fileList"
      :auto-upload="false"
      :before-upload="handleBeforeUpload">
      <i class="el-icon-plus"></i>
    </el-upload>
  </div>
</template>

<script>
export default {
  data() {
    return {
      fileList: [], // 用于存储上传的图片文件对象
      formData: {
        imageData: '' // 编辑时，假设这里保存了 Base64 字符串
      }
    }
  },
  methods: {
    handleBeforeUpload(file) {
      // 利用 FileReader 转换为 Base64
      const reader = new FileReader();
      reader.readAsDataURL(file);
      reader.onload = (e) => {
        // 将 Base64 字符串存入表单数据
        this.formData.imageData = e.target.result;
        // 同时构造 fileList 数组用于 el-upload 的回显（如果需要多图上传，这里可以 push 多个文件对象）
        this.fileList = [{
          name: file.name,
          url: e.target.result
        }];
      };
      // 返回 false 阻止组件默认上传行为
      return false;
    }
  },
  created() {
    const imgBase64 = 'data:image/png;base64,'
    // 编辑表单时，如果已有图片数据，则直接赋值 fileList 实现回填
    this.fileList = [{
      name: '已上传图片',
      url: imgBase64
    }];
  }
}
</script>
